import { createSlice, createAsyncThunk } from "@reduxjs/toolkit";
import axios from "../../axios";


export const fetchUserForChoice = createAsyncThunk("Asses/fetchCategories", async () => {
    try {
        const { data } = await axios.get("/Asses")
        let dataCategory = data
        return dataCategory
    } catch (error) {
        console.log(error)
    }
})


const initialState = {
    typeAuth: "login"
}

export const TypeAuthSlice = createSlice({
    name: "TypeAuth",
    initialState,
    reducers: {
        changeTypeAuth: (state, action) => {
            state.typeAuth = action.payload
        }
    }
})

export const { changeTypeAuth } = TypeAuthSlice.actions

export default TypeAuthSlice.reducer
